                <div class="text-banner">
                    
                        <h2>WHO WE ARE</h2>
                    
                    <p>IE University is an institution of higher learning that specializes in training impactful leaders capable of creating a better tomorrow. As restless entrepreneurs, we always seek out new ways to innovate in order to provide the most up-to-date education imaginable. This is reflected in our dynamic ecosystem, which comprises an extensive, top-tier global network, world-class virtual and on-campus facilities, an inspirational faculty and prestigious institutional partnerships. Our innovative mix of diverse, visionary minds regularly sparks new ideas, offering creative solutions to tomorrow’s problems across all our subject areas. We are an institution of impact. We aim for nothing less.</p>

                </div>
